\viewkind4\uc1\pard\sl360\slmult1\lang2057\f0\fs28      Crumpling a sheet of paper seems simple and doesn't require much effort, but explaining why the crumpled ball behaves the way it does is another matter entirely. A scrunched paper ball is more than 75 percent air. Yet it displays surprising strength and resistance to further compression, a fact that has confounded physicists. A report in Physical Review Letters, though, describes one aspect of the behavior of crumpled sheets: how their size changes in relation to the force they withstand.\par
     A crushed thin sheet is essentially a mass of conical points connected by curved energy-storing ridges. When the sheet is further compressed, these ridges collapse and smaller ones form, increasing the amount of stored energy within the wad. Scientists at the University of Chicago modeled how the force required to compress the ball relates to its size. After the crumpling of a sheet of thin aluminized Mylar, the researchers placed it inside a cylinder. They equipped the cylinder with a piston to crush the sheet. Instead of collapsing to a final fixed size, the height of the crushed ball continued to decrease, even three weeks after the application of weight.\par
